    frequency = {}
    max_freq = 1
    for num in nums:
        if num in frequency:
            frequency[num] += 1
        else:
            frequency[num] = 1
        max_freq = max(max_freq, frequency[num])
    modes = []
    for num in frequency:
        if frequency[num] == max_freq:
            modes.append(num)
    return sorted(modes)

